"<div>\n<i class=\"NoteType\">\nPaikan lis\u00e4tietoja\n</i>\n<div class=\"grampsstylednote\">\n<p>\nAkaa jaettiin 1946 Toijalan, Kylm\u00e4kosken, S\u00e4\u00e4ksm\u00e4en ja Viialan kesken. Akaa-nimi otettiin uudelleen k\u00e4ytt\u00f6\u00f6n 1. tammikuuta 2007 Viialan ja Toijalan yhdistyess\u00e4 Akaan kaupungiksi.\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
