"<div>\n<i class=\"NoteType\">\nPaikan lis\u00e4tietoja\n</i>\n<div class=\"grampsstylednote\">\n<p>\nM\u00e4\u00e4ritelm\u00e4n mukaan ryhm\u00e4kyl\u00e4 on rakennettu tihe\u00e4sti yhten\u00e4iselle tonttialueelle. Alkuper\u00e4isl\u00e4hteiss\u00e4 on k\u00e4ytetty kyl\u00e4n nimen\u00e4 Ryhm\u00e4kyl\u00e4 m\u00e4\u00e4rittelem\u00e4tt\u00e4 miss\u00e4 mik\u00e4kin ryhm\u00e4kyl\u00e4 sijaitsi. Pyh\u00e4j\u00e4rvell\u00e4 oli yksi melko selke\u00e4 ryhm\u00e4kyl\u00e4 Yl\u00e4j\u00e4rven kyl\u00e4n tienoilla, ja naapuripit\u00e4j\u00e4ss\u00e4 K\u00e4kisalmen maalaiskunnassa oli oma ryhm\u00e4kyl\u00e4ns\u00e4. Paikannimi \"Alakyl\u00e4n ryhm\u00e4kyl\u00e4\" tulee t\u00e4h\u00e4n siit\u00e4, ett\u00e4 osa tapahtumista, jotka alkuper\u00e4isl\u00e4hteisiin on merkitty Pyh\u00e4j\u00e4rven Ryhm\u00e4kyl\u00e4\u00e4n, eiv\u00e4t muista tapahtumista p\u00e4\u00e4tellen kuulu luontevasti Yl\u00e4j\u00e4rvelle vaan paremmin Alakyl\u00e4\u00e4n, joten on p\u00e4\u00e4telty ett\u00e4 Alakyl\u00e4nkin tienoilla oli tuona aikana ryhm\u00e4kyl\u00e4.\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
