"<div>\n<i class=\"NoteType\">\nPaikan lis\u00e4tietoja\n</i>\n<div class=\"grampsstylednote\">\n<p>\nJokioinen (Jokiois) oli kinkerikunta (f\u00f6rh\u00f6r), jonka sijaintia ja laajuutta voi p\u00e4\u00e4tell\u00e4 rippikirjasta 1821-1831. Jokioisten kinkerikuntaan kuluivat rippikirjan mukaan mm. J\u00e4ms\u00e4n Alhoj\u00e4rven l\u00e4nsipuolella sijaitsevat Jokela, Vistaj\u00e4rvi, Pet\u00e4isj\u00e4rvi ja Valkeaj\u00e4rvi. Jokelan talo Partalankoskella, Nytkymenjoen tuntumassa, kuului vuonna 2020 Partala-nimiseen kyl\u00e4\u00e4n. Jokioisten koulu toimi Yl\u00e4-Partalassa vuodesta 1924 1960-luvulle saakka.<br />\nL\u00e4hde: museo24, J\u00e4ms\u00e4n kouluja, <br />\nPartalan koulu: http://www.museo24.fi/?action[]=INavigation::viewArticle(4935) / Viitattu 30.7.2024\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
