"<div>\n<i class=\"NoteType\">\nPaikan lis\u00e4tietoja\n</i>\n<div class=\"grampsstylednote\">\n<p>\nVarhaisin kirjallinen tieto Juupajoesta on keskiajalta, jolloin asiakirjoissa mainitaan \"Juupa utmark\" - Juupan er\u00e4maa. Juupajoki oli ensin osa Suur-\u200bKangasalan hallintopit\u00e4j\u00e4\u00e4. 1540-\u200bluvulta l\u00e4htien Juupajoki kuului Oriveden pit\u00e4j\u00e4\u00e4n, kunnes siit\u00e4 tuli itsen\u00e4inen kunta noin v. 1913. L\u00e4hde: https://juupajoki.fi/kuntainfo/juupajoen-historiaa/  / Viitattu 9.6.2024\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
