"<div>\n<i class=\"NoteType\">\nPaikan lis\u00e4tietoja\n</i>\n<div class=\"grampsstylednote\">\n<p>\nJ\u00e4ms\u00e4nkoski erosi J\u00e4ms\u00e4st\u00e4 vuonna 1926. J\u00e4ms\u00e4nkoskeen liitettiin Koskenp\u00e4\u00e4n kunta vuonna 1969. J\u00e4ms\u00e4nkoski ja J\u00e4ms\u00e4 yhdistyiv\u00e4t j\u00e4lleen vuonna 2009.\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
