"<div>\n<i class=\"NoteType\">\nPaikan lis\u00e4tietoja\n</i>\n<div class=\"grampsstylednote\">\n<p>\nTietoja paikasta Kiukkoila<br />\n\"Koordinaatit (ETRS-TM35FIN): P=6861420 I=403900 Z= 90<br />\nKoordinaattiselite:  Arvioidut keskikoordinaatit<br />\nInventointihavainnot:  Kohde sijaitsee Lopotissa J\u00e4ms\u00e4njoen l\u00e4nsipuolella, kirkosta noin 500 metri\u00e4 l\u00e4nteen. Kiukkoilassa oli kaksi taloa v. 1539. 1730 Kiukkoilassa oli kaksi taloa Sakari ja Hopsu. Sakarin nimell\u00e4 kyl\u00e4 n\u00e4kyy 1780-luvun rekognosointikartassa. Alueella on nykyisin kerrostaloja ja historiallisen ajan asuinpaikka on tuhoutunut.\"<br />\nL\u00e4hde: J\u00e4ms\u00e4, Taajaman osayleiskaava-alueen arkeologinen inventointi 2015-2016, Museovirasto:<br />\nhttps://jamsantaajamaosayleiskaava.fi/wp-content/uploads/Liite7_Arkeologinen_inventointi_2016-06-22.pdf / Viitattu 30.7.2024\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
