"<div>\n<i class=\"NoteType\">\nPaikan lis\u00e4tietoja\n</i>\n<div class=\"grampsstylednote\">\n<p>\nPihlajaveden uudelle kirkolle pidettiin hyv\u00e4ksyv\u00e4 lopputarkastus 29.7.1871. Uusi kirkko sijaitsee Kolehmanm\u00e4ell\u00e4, Kirkkotien p\u00e4\u00e4ss\u00e4. Vanha hautausmaa sijaitsee K\u00f6ntt\u00e4rin (Kolehman) alueella. L\u00e4hde: https://www.keuruunmuseo.fi/index.php/kotiseututietoa/pihlajavesi / Viitattu 25.6.2023\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
