"<div>\n<i class=\"NoteType\">\nPaikan lis\u00e4tietoja\n</i>\n<div class=\"grampsstylednote\">\n<p>\n\"Kirvun pit\u00e4j\u00e4n halki virtasi kaksi suurenlaista jokea, Helisev\u00e4njoki ja Kuunjoki, joiden vesireitit olivat kirvulaisille hyvinkin merkitt\u00e4vi\u00e4. Molemmat joet tulivat Rautj\u00e4rven puolelta. N\u00e4iss\u00e4 joissa uittivat puutavarayhti\u00f6t kev\u00e4isin ja kes\u00e4ll\u00e4kin huomattavia m\u00e4\u00e4ri\u00e4 puutavaraa ... Sahateollisuutta oli Kirvussa huomattavan paljon. Inkil\u00e4n ja Sairalan sahat olivat suurimmat ... Niit\u00e4 oli syntynyt joissa olevien koskien partaalle, koskistahan ne saivat entisaikaan tarpeellista k\u00e4ytt\u00f6voimaa. Inkil\u00e4n saha oli kaiketi Kirvun vanhin. Sen perusti v 1774 haminalaisen raatimiehen ja kauppiaan Wolter Wilhelm Stewenin perikunta Kuunjoen vesist\u00f6ss\u00e4 olevan V\u00e4\u00e4r\u00e4kosken rannalle l\u00e4helle Inkil\u00e4n nykyist\u00e4 asemaa. V\u00e4\u00e4r\u00e4kosken saha paloi 1796, mutta sen toiminta jatkui jossain muodossa aina vuoteen 1798, jolloin yleinen sahauskielto lopetti toiminnan.\" L\u00e4hde: Karjalan N:o 13 - 1971 Liite (15), Pit\u00e4j\u00e4 pit\u00e4j\u00e4lt\u00e4, Kirvu, sivu 15, Mikko Verta: \"Kirvun sahat ja myllyt\", https://www.luovutettukarjala.fi/pitajat/pitajaliitteet/kirvu.pdf / Viitattu 26.6.2023\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
