"<div>\n<i class=\"NoteType\">\nPaikan lis\u00e4tietoja\n</i>\n<div class=\"grampsstylednote\">\n<p>\n\"Joen l\u00e4nsirannalla keskiaikaisia taloja ovat seuraavat etel\u00e4st\u00e4 lukien: Kaipola, Viiala, Saari, K\u00e4h\u00f6, Kauhkiala, Seppola, Kelh\u00e4, Heikkil\u00e4, Pietil\u00e4, Kiukkoila, Toivila, Kannila, Niemola. N\u00e4ist\u00e4 kolme ensimm\u00e4ist\u00e4 ja viisi viimeksi mainittua osuvat valtakunnallisesti merkitt\u00e4v\u00e4lle rakennetun kulttuuriymp\u00e4rist\u00f6n alueelle.\"\n</p>\n<p>\nMiemoila eli Niemola<br />\n\"Koordinaatit (ETRS-TM35FIN): P=6862140 I=403700 Z= 93<br />\nKoordinaattiselite:  Arvioidut keskikoordinaatit<br />\nInventointihavainnot: Kohde sijaitsee J\u00e4ms\u00e4njoen l\u00e4nsipuolella, noin 900 metri\u00e4 J\u00e4ms\u00e4n kirkosta luoteeseen. Miemolassa oli v. 1539 kolme taloa. Talo m\u00e4\u00e4r\u00e4 pysyi ilmeisesti aika lailla saman, sill\u00e4 vuonna 1730 taloja oli my\u00f6s kolme. Kyl\u00e4 on sijoitettavissa 1780-luvun rekognosointikartan perusteella Lopotin pohjoisosassa olevalle pellolle. Pellon etel\u00e4puolella on omakotitaloalue, jolle johtaa Niemolantie, mutta itse Niemola ei ole ollut tien varressa. Kohde tarkastettiin vuoden 2015-2016 inventoinnissa, se osa peltoa, jolla kyl\u00e4 on todenn\u00e4k\u00f6isesti sijainnut\u2026 Samalta pellolta on l\u00f6ytynyt metallinpaljastimen avulla viikinkiajalta per\u00e4isin olevia koruja ja korufragmentteja kynt\u00f6kerroksesta...\"<br />\nL\u00e4hde: J\u00e4ms\u00e4, Taajaman osayleiskaava-alueen arkeologinen inventointi 2015-2016, Museovirasto:<br />\nhttps://jamsantaajamaosayleiskaava.fi/wp-content/uploads/Liite7_Arkeologinen_inventointi_2016-06-22.pdf / Viitattu 30.7.2024\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
