"<div>\n<i class=\"NoteType\">\nPaikan lis\u00e4tietoja\n</i>\n<div class=\"grampsstylednote\">\n<p>\nP\u00e4\u00e4telty J\u00e4ms\u00e4n vuosien 1781-1792 rippikirjasta vuoden 2020 kartasta, ett\u00e4 Rantala oli tila tai talo Kaipolassa Peltolan, Sillanp\u00e4\u00e4n ja Laholan l\u00e4hell\u00e4. Peltolan ja Laholan talot ovat viel\u00e4 vuoden 2020 kartalla.\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
