"<div>\n<i class=\"NoteType\">\nPaikan lis\u00e4tietoja\n</i>\n<div class=\"grampsstylednote\">\n<p>\nKangasalasta siirrettiin vuonna 1926 Oriveteen Ruokonen, Sarkkila ja Siitama.\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
