"<div>\n<i class=\"NoteType\">\nPaikan lis\u00e4tietoja\n</i>\n<div class=\"grampsstylednote\">\n<p>\nSijaitsiko S\u00e4\u00e4ksm\u00e4en pit\u00e4j\u00e4n Ruudala tai Rudala -niminen tila Huittulan, Liuttula vai Liettulan kyl\u00e4ss\u00e4? Vuoden 1881 rustholliluettelossa on S\u00e4\u00e4ksm\u00e4ell\u00e4 kyl\u00e4 \"Liettula\", jossa rusthollit \"Kalkonen l. lmmala\" ja \"Rudala\". Kotus-nimiarkiston mukaan S\u00e4\u00e4ksm\u00e4ell\u00e4 on tunnettu kyl\u00e4nosan nimen\u00e4 Liettula, mutta sen \"sijainti on tiedossa vain keruupit\u00e4j\u00e4n tarkkuudella\". Liettulaa ei l\u00f6ytynyt kartalta. Liettula-niminen talo on ollut S\u00e4\u00e4ksm\u00e4ell\u00e4, mutta Esko Karisalmen mukaan Anajala, Liettula ja Huittula n\u00e4ytt\u00e4v\u00e4t sulautuneen yhdeksi Huittula-nimiseksi kyl\u00e4yhteiskunnaksi 1600-luvulla. Karisalmi mainitsee my\u00f6s Huittulan Rutala-nimisen talon. S\u00e4\u00e4sm\u00e4en rippikirjassa 1836-1842 on \"Norra Huittula, Ruudala eller Pohja \u00bd Rusth\u00e5ll\". Kirjoitusvirheit\u00e4, erilaisia kirjoitusmuotoja, kadonnut kyl\u00e4, kadonneita taloja?\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
"",
"<div>\n<i class=\"NoteType\">\nPaikan lis\u00e4tietoja\n</i>\n<div class=\"grampsstylednote\">\n<p>\nM\u00e4\u00e4ritelm\u00e4n mukaan ryhm\u00e4kyl\u00e4 on rakennettu tihe\u00e4sti yhten\u00e4iselle tonttialueelle. Alkuper\u00e4isl\u00e4hteiss\u00e4 on k\u00e4ytetty kyl\u00e4n nimen\u00e4 Ryhm\u00e4kyl\u00e4 m\u00e4\u00e4rittelem\u00e4tt\u00e4 miss\u00e4 mik\u00e4kin ryhm\u00e4kyl\u00e4 sijaitsi. Kartoista ja tapahtumista on p\u00e4\u00e4telty, ett\u00e4 Pyh\u00e4j\u00e4rven \"Ryhm\u00e4kyl\u00e4\" oli joko Yl\u00e4j\u00e4rven kyl\u00e4n osa tai sijaitsi Yl\u00e4j\u00e4rven kyl\u00e4n it\u00e4isen\u00e4 ja etel\u00e4isen\u00e4 naapurina niin ett\u00e4 Ryhm\u00e4kyl\u00e4n asutus oli Yl\u00e4j\u00e4rven rannalla ja maat ulottuivat sielt\u00e4 lounaan suuntaan rajoittuen siell\u00e4 Korkkalan ja Enkkuan maihin.\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
