"<div>\n<i class=\"NoteType\">\nPaikan lis\u00e4tietoja\n</i>\n<div class=\"grampsstylednote\">\n<p>\nOsa Saaprun kyl\u00e4n tapahtumista merkittiin Pyh\u00e4j\u00e4rven ja osa Sakkolan kirkonkirjoihin. Saapru oli 1930-luvulla kyl\u00e4 Viipurin l\u00e4\u00e4nin Pyh\u00e4j\u00e4rvell\u00e4. Aikaisemmin my\u00f6s Sakkolan kirjoissa esiintyy Saaprun kyl\u00e4.\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
"<div>\n<i class=\"NoteType\">\nPaikan lis\u00e4tietoja\n</i>\n<div class=\"grampsstylednote\">\n<p>\nOsa Saaprun kyl\u00e4n tapahtumista merkittiin Pyh\u00e4j\u00e4rven ja osa Sakkolan kirkonkirjoihin.\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
